import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Formik, Field, Form, ErrorMessage } from "formik";
import * as Yup from "yup";

import { register } from "../slices/auth";
import { clearMessage } from "../slices/message";

const Register = () => {
  const [successful, setSuccessful] = useState(false);
  const [state, setState] = useState({ username: '', password: '', passwordConfirm: '', mailAddress: '', firstname: '', lastname: '' })


  const { message } = useSelector((state) => state.message);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(clearMessage());
  }, [dispatch]);

  const initialValues = {
    username: "",
    mailAddress: "",
    password: "",
    firstname: "",
    lastname : ""
  };

  const validationSchema = Yup.object().shape({
    username: Yup.string()
      .test(
        "len",
        "The username must be between 3 and 20 characters.",
        (val) =>
          val &&
          val.toString().length >= 3 &&
          val.toString().length <= 20
      )
      .required("This field is required!"),
    email: Yup.string()
      .email("This is not a valid email.")
      .required("This field is required!"),
    password: Yup.string()
      .test(
        "len",
        "The password must be between 6 and 40 characters.",
        (val) =>
          val &&
          val.toString().length >= 6 &&
          val.toString().length <= 40
      )
      .required("This field is required!"),
  });

  const handleChange = (e) => {
    e.preventDefault()
    const { name, value } = e.target;
    if (name === "username") {
      setState(prevState => {
        return { ...prevState, username: value }
      })
    } else if (name === "mailAddress") {
      setState(prevState => {
        return { ...prevState, mailAddress: value }
      })
    } else if (name === "firstname") {
      setState(prevState => {
        return { ...prevState, firstname: value }
      })
    } else if (name === "lastname") {
      setState(prevState => {
        return { ...prevState, lastname: value }
      })
    } else if (name === "password") {
      setState(prevState => {
        return { ...prevState, password: value }
      })
    } else if (name === "passwordConfirm") {
      setState(prevState => {
        return { ...prevState, passwordConfirm: value }
      })
    }
  }

  // const handleRegister = (formValue) => {
  //   console.log("testtest")
  //   console.log(username, mailAddress, password, firstname, lastname)
  //   setSuccessful(false);

  //   dispatch(register({ username, firstname, password, lastname, mailAddress }))
  //     .unwrap()
  //     .then(() => {
  //       setSuccessful(true);
  //     })
  //     .catch(() => {
  //       setSuccessful(false);
  //     });
  // };

  return (
    <div className="col-md-12 signup-form">
      <div className="card card-container">
        <Formik
          initialValues={initialValues}
          validationSchema={validationSchema}
          onSubmit={handleRegister}
        >
          <Form>
            {!successful && (
              <div>
                <div className="form-group">
                  <label htmlFor="username">Username</label>
                  <Field name="username" type="text" className="form-control" />
                  <ErrorMessage
                    name="username"
                    component="div"
                    className="alert alert-danger"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="email">Email</label>
                  <Field name="mailAddress" type="email" className="form-control" />
                  <ErrorMessage
                    name="mailAddress"
                    component="div"
                    className="alert alert-danger"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="firstname">First Name</label>
                  <Field name="firstname" type="text" className="form-control" />
                  <ErrorMessage
                    name="firstname"
                    component="div"
                    className="alert alert-danger"
                  />
                </div>
                <div className="form-group">
                  <label htmlFor="email">Last Name</label>
                  <Field name="lastname" type="text" className="form-control" />
                  <ErrorMessage
                    name="lastname"
                    component="div"
                    className="alert alert-danger"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="password">Password</label>
                  <Field
                    name="password"
                    type="password"
                    className="form-control"
                  />
                  <ErrorMessage
                    name="password"
                    component="div"
                    className="alert alert-danger"
                  />
                </div>

                <div className="form-group">
                  <button type="submit" className="btn btn-primary btn-block" onClick={handleRegister}>Sign Up</button>
                </div>
              </div>
            )}
          </Form>
        </Formik>
      </div>

      {message && (
        <div className="form-group">
          <div
            className={successful ? "alert alert-success" : "alert alert-danger"}
            role="alert"
          >
            {message}
          </div>
        </div>
      )}
    </div>
  );
};

export default Register;
